package Ifelse;

public class loops {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int i=6 ;
		int k ;
		for(k=2; k<=i; k++){
		
			if(i%k==0){
				
				break;
			
			}
		
		}
		
		if(i==k){
			
			System.out.println("Prime")	;
		}
		else {
			System.out.println("not prime");
		}
		
	}
	






}